import React, { useEffect, useState } from 'react'
import styled from 'styled-components'



function Allcrypto() {

    const [items, setItems] = useState([])



    useEffect(() => {
        fetch("https://api2.binance.com/api/v3/ticker/24hr")
            .then(res => res.json())
            .then(
                (result) => {
                    //   setIsLoaded(true);
                    setItems(result);
                    // console.log(result)
                },
                (error) => {
                    console.log(error)
                }
            )
    }, [])

    return (
        <Allcryp>
            <h1>All crypto</h1>
                <thead>
                    <th>NAME</th>
                    <th>PRICE</th>
                    <th>24H CHANGE</th>
                    <th>24H VOLUME</th>
                </thead>
                {items.map((item) => {
                    return (
                        <Home>
                            <tr>
                                <td>{item.symbol}</td>
                                <td>{item.weightedAvgPrice}</td>
                                <td>{item.priceChangePercent}</td>
                                <td>{item.volume}</td>
                            </tr>

                </Home>)
            })}
        </Allcryp>
    )
}

export default Allcrypto
const Allcryp = styled.div `
th{
    padding:1rem;
}

`
const Home = styled.div``
const Symbol = styled.p`
`
